<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><br><br>
</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><b>Passo
1:</b> Para criar um novo usuário, é preciso criar o grupo em que
ele será colocado. Clique em &quot;Segurança&quot; na barra lateral
e, logo após, em &quot;Grupos de Usuário&quot;</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><img src="data:image/png;base64," name="Imagem 15" align="bottom" width="624" height="393" border="0"></p>
