</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><b>Passo
2:</b> Note que já existe um grupo cadastrado chamado
&quot;Administrador&quot;. Ele é criado automaticamente pelo
sistema. Clique em &quot;Novo&quot;, escolha um nome e grave.</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><img src="data:image/png;base64," name="Imagem 19" align="bottom" width="624" height="390" border="0"></p>
<ul>
    <li><p align="justify" style="margin-bottom: 0.21cm; line-height: 100%">
    Os nomes dos grupos podem ser alterados a qualquer momento, através
    do botão “Alterar”.</p>
</ul>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><b>Passo
3:</b> Em seguida, clique em &quot;Grupos/Permissões&quot; no menu
&quot;Segurança&quot;. Você poderá alterar as permissões de
acesso de todos os grupos.</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><br><br>
</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><img src="data:image/png;base64," name="Imagem 20" align="bottom" width="624" height="391" border="0"></p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><br><br>
</p>
<p align="justify" style="margin-bottom: 0.21cm; background: #ffffff; line-height: 100%">
Na tela seguinte, aparecerão as <u>permissões</u> ACESSAR, INCLUIR,
ALTERAR, EXCLUIR, VISUALIZAR, EXPORTAR ou IMPRIMIR. Defina as
permissões do grupo e grave.</p>
<p align="justify" style="margin-bottom: 0.21cm; line-height: 100%"><br><br>
</p>
